import React from "react";
import { Routes } from "react-router-dom";
import Navbar from "../Navbar";
import Home from "../../component/Home";

const AdminPortal = () => {
  return (
    <div>
      <Navbar/>
      <Routes>
      <Route element={<Home />} path="/" />
      </Routes>
     
    </div>
  );
};

export default AdminPortal;
